    state->vars[ 50 ] = 0;
    state->vars[ 51 ] = 0;
    state->vars[ 52 ] = 1;
    state->vars[ 53 ] = 0;
    state->vars[ 54 ] = 0;
    state->vars[ 55 ] = 0;
